import React from "react";
import "./contact.css"


export default function ContactUs() {
  return (
    <>
    <div className="contact">
      <h1>Contact Us Here :</h1>
      <p>Address: Pushtikar Society, Office # 1, Saraswati Apartment, Patel</p><br />
      <p>Estate Rd, opp. Irirs Park, Jogeshwari West, Mumbai, Maharashtra</p><br/>
      <p>400102</p><br />
      <p>Phone: 097683 44835</p><br />

    </div>
    </>
  );
}
